INSERT INTO `wp_wc_admin_notes` VALUES (1,'wc-refund-returns-page','info','en_US','Setup a Refund and Returns Policy page to boost your store\'s credibility.','We have created a sample draft Refund and Returns Policy page for you. Please have a look and update it to fit your store.','{}','unactioned','woocommerce-core','2022-08-11 18:54:22',NULL,0,'plain','',0,0,'info'),(2,'wc-admin-complete-store-details','info','en_US','Add your store details to complete store setup','Complete your store details with important information for setup such as your stores base address','{}','unactioned','woocommerce-admin','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(3,'new_in_app_marketplace_2021','info','en_US','Customize your store with extensions','Check out our NEW Extensions tab to see our favorite extensions for customizing your store, and discover the most popular extensions in the WooCommerce Marketplace.','{}','unactioned','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(4,'wayflyer_bnpl_q4_2021','marketing','en_US','Grow your business with funding through Wayflyer','Fast, flexible financing to boost cash flow and help your business grow  one fee, no interest rates, penalties, equity, or personal guarantees. Based on your stores performance, Wayflyer provides funding and analytical insights to invest in your business.','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(5,'wc_shipping_mobile_app_usps_q4_2021','marketing','en_US','Print and manage your shipping labels with WooCommerce Shipping and the WooCommerce Mobile App','Save time by printing, purchasing, refunding, and tracking shipping labels generated by <a href=\"https://woocommerce.com/woocommerce-shipping/\">WooCommerce Shipping</a>  all directly from your mobile device!','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(6,'wc_shipping_mobile_app_q4_2021','marketing','en_US','Print and manage your shipping labels with the WooCommerce Mobile App','Save time by printing, purchasing, refunding, and tracking shipping labels generated by <a href=\"https://woocommerce.com/woocommerce-shipping/\">WooCommerce Shipping</a>  all directly from your mobile device!','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(7,'ecomm-need-help-setting-up-your-store','info','en_US','Need help setting up your Store?','Schedule a free 30-min <a href=\"https://wordpress.com/support/concierge-support/\">quick start session</a> and get help from our specialists. Were happy to walk through setup steps, show you around the WordPress.com dashboard, troubleshoot any issues you may have, and help you the find the features you need to accomplish your goals for your site.','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(8,'woocommerce-services','info','en_US','WooCommerce Shipping & Tax','WooCommerce Shipping &amp; Tax helps get your store \"ready to sell\" as quickly as possible. You create your products. We take care of tax calculation, payment processing, and shipping label printing! Learn more about the extension that you just installed.','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(9,'ecomm-unique-shopping-experience','info','en_US','For a shopping experience as unique as your customers','Product Add-Ons allow your customers to personalize products while they\'re shopping on your online store. No more follow-up email requestscustomers get what they want, before they\'re done checking out. Learn more about this extension that comes included in your plan.','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(10,'wc-admin-getting-started-in-ecommerce','info','en_US','Getting Started in eCommerce - webinar','We want to make eCommerce and this process of getting started as easy as possible for you. Watch this webinar to get tips on how to have our store up and running in a breeze.','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(11,'your-first-product','info','en_US','Your first product','Thats huge! Youre well on your way to building a successful online store  now its time to think about how youll fulfill your orders.<br /><br />Read our shipping guide to learn best practices and options for putting together your shipping strategy. And for WooCommerce stores in the United States, you can print discounted shipping labels via USPS with <a href=\"https://href.li/?https://woocommerce.com/shipping\" target=\"_blank\">WooCommerce Shipping</a>.','{}','unactioned','woocommerce.com','2022-08-12 16:47:50',NULL,0,'plain','',0,0,'info'),(12,'wc-admin-optimizing-the-checkout-flow','info','en_US','Optimizing the checkout flow','Its crucial to get your stores checkout as smooth as possible to avoid losing sales. Lets take a look at how you can optimize the checkout experience for your shoppers.','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(13,'wc-admin-first-five-things-to-customize','info','en_US','The first 5 things to customize in your store','Deciding what to start with first is tricky. To help you properly prioritize, weve put together this short list of the first few things you should customize in WooCommerce.','{}','unactioned','woocommerce.com','2022-08-14 05:13:40',NULL,0,'plain','',0,0,'info'),(14,'wc-payments-qualitative-feedback','info','en_US','WooCommerce Payments setup - let us know what you think','Congrats on enabling WooCommerce Payments for your store. Please share your feedback in this 2 minute survey to help us improve the setup process.','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(15,'share-your-feedback-on-paypal','info','en_US','Share your feedback on PayPal','Share your feedback in this 2 minute survey about how we can make the process of accepting payments more useful for your store.','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(16,'google_listings_and_ads_install','marketing','en_US','Drive traffic and sales with Google','Reach online shoppers to drive traffic and sales for your store by showcasing products across Google, for free or with ads.','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(17,'wc-subscriptions-security-update-3-0-15','info','en_US','WooCommerce Subscriptions security update!','We recently released an important security update to WooCommerce Subscriptions. To ensure your sites data is protected, please upgrade <strong>WooCommerce Subscriptions to version 3.0.15</strong> or later.<br /><br />Click the button below to view and update to the latest Subscriptions version, or log in to <a href=\"https://woocommerce.com/my-dashboard\">WooCommerce.com Dashboard</a> and navigate to your <strong>Downloads</strong> page.<br /><br />We recommend always using the latest version of WooCommerce Subscriptions, and other software running on your site, to ensure maximum security.<br /><br />If you have any questions we are here to help  just <a href=\"https://woocommerce.com/my-account/create-a-ticket/\">open a ticket</a>.','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(18,'woocommerce-core-update-5-4-0','info','en_US','Update to WooCommerce 5.4.1 now','WooCommerce 5.4.1 addresses a checkout issue discovered in WooCommerce 5.4. We recommend upgrading to WooCommerce 5.4.1 as soon as possible.','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(19,'wcpay-promo-2020-11','marketing','en_US','wcpay-promo-2020-11','wcpay-promo-2020-11','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(20,'wcpay-promo-2020-12','marketing','en_US','wcpay-promo-2020-12','wcpay-promo-2020-12','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(21,'ppxo-pps-upgrade-paypal-payments-1','info','en_US','Get the latest PayPal extension for WooCommerce','Heads up! Theres a new PayPal on the block!<br /><br />Now is a great time to upgrade to our latest <a href=\"https://woocommerce.com/products/woocommerce-paypal-payments/\" target=\"_blank\">PayPal extension</a> to continue to receive support and updates with PayPal.<br /><br />Get access to a full suite of PayPal payment methods, extensive currency and country coverage, and pay later options with the all-new PayPal extension for WooCommerce.','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(22,'ppxo-pps-upgrade-paypal-payments-2','info','en_US','Upgrade your PayPal experience!','Get access to a full suite of PayPal payment methods, extensive currency and country coverage, offer subscription and recurring payments, and the new PayPal pay later options.<br /><br />Start using our <a href=\"https://woocommerce.com/products/woocommerce-paypal-payments/\" target=\"_blank\">latest PayPal today</a> to continue to receive support and updates.','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(23,'woocommerce-core-sqli-july-2021-need-to-update','update','en_US','Action required: Critical vulnerabilities in WooCommerce','In response to a critical vulnerability identified on July 13, 2021, we are working with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br />Our investigation into this vulnerability is ongoing, but <strong>we wanted to let you know now about the importance of updating immediately</strong>.<br /><br />For more information on which actions you should take, as well as answers to FAQs, please urgently review our blog post detailing this issue.','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(24,'woocommerce-blocks-sqli-july-2021-need-to-update','update','en_US','Action required: Critical vulnerabilities in WooCommerce Blocks','In response to a critical vulnerability identified on July 13, 2021, we are working with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br />Our investigation into this vulnerability is ongoing, but <strong>we wanted to let you know now about the importance of updating immediately</strong>.<br /><br />For more information on which actions you should take, as well as answers to FAQs, please urgently review our blog post detailing this issue.','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(25,'woocommerce-core-sqli-july-2021-store-patched','update','en_US','Solved: Critical vulnerabilities patched in WooCommerce','In response to a critical vulnerability identified on July 13, 2021, we worked with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br /><strong>Your store has been updated to the latest secure version(s)</strong>. For more information and answers to FAQs, please review our blog post detailing this issue.','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(26,'woocommerce-blocks-sqli-july-2021-store-patched','update','en_US','Solved: Critical vulnerabilities patched in WooCommerce Blocks','In response to a critical vulnerability identified on July 13, 2021, we worked with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br /><strong>Your store has been updated to the latest secure version(s)</strong>. For more information and answers to FAQs, please review our blog post detailing this issue.','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(27,'habit-moment-survey','marketing','en_US','Were all ears! Share your experience so far with WooCommerce','Wed love your input to shape the future of WooCommerce together. Feel free to share any feedback, ideas or suggestions that you have.','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(28,'ecomm-wc-navigation-survey','info','en_US','Wed like your feedback on the WooCommerce navigation','Were making improvements to the WooCommerce navigation and would love your feedback. Share your experience in this 2 minute survey.','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(29,'woocommerce-core-paypal-march-2022-updated','update','en_US','Security auto-update of WooCommerce','<strong>Your store has been updated to the latest secure version of WooCommerce</strong>. We worked with WordPress to deploy PayPal Standard security updates for stores running WooCommerce (version 3.5 to 6.3). Its recommended to disable PayPal Standard, and use <a href=\"https://woocommerce.com/products/woocommerce-paypal-payments/\" target=\"_blank\">PayPal Payments</a> to accept PayPal.','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(30,'woocommerce-core-paypal-march-2022-updated-nopp','update','en_US','Security auto-update of WooCommerce','<strong>Your store has been updated to the latest secure version of WooCommerce</strong>. We worked with WordPress to deploy security updates related to PayPal Standard payment gateway for stores running WooCommerce (version 3.5 to 6.3).','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(31,'pinterest_03_2022_update','marketing','en_US','Your Pinterest for WooCommerce plugin is out of date!','Update to the latest version of Pinterest for WooCommerce to continue using this plugin and keep your store connected with Pinterest. To update, visit <strong>Plugins &gt; Installed Plugins</strong>, and click on update now under Pinterest for WooCommerce.','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(32,'store_setup_survey_survey_q2_2022','survey','en_US','How is your store setup going?','Our goal is to make sure you have all the right tools to start setting up your store in the smoothest way possible.\r\nWed love to know if we hit our mark and how we can improve. To collect your thoughts, we made a 2-minute survey.','{}','unactioned','woocommerce.com','2022-08-19 19:27:41',NULL,0,'plain','',0,0,'info'),(33,'wc-admin-wisepad3','marketing','en_US','Take your business on the go in Canada with WooCommerce In-Person Payments','Quickly create new orders, accept payment in person for orders placed online, and automatically sync your inventory  no matter where your business takes you. With WooCommerce In-Person Payments and the WisePad 3 card reader, you can bring the power of your store anywhere.','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(34,'mercado_pago_q3_2022','marketing','en_US','Get paid with Mercado Pago Checkout','Give your customers a checkout they can trust with Latin America\'s leading payment processor. Securely accept debit and credit cards, cash, bank transfers, and installment payments  backed by exclusive fraud prevention tools.','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(35,'klarna_q3_2022','marketing','en_US','Meet Klarna  your ultimate growth partner','Increase conversions by offering secure, flexible payment solutions  including buy now, pay later  all through a one-click checkout experience. Plus, youll tap into a whole new market of the worlds most engaged shoppers.','{}','unactioned','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(36,'woocommerce-payments-august-2022-need-to-update','update','en_US','Action required: Please update WooCommerce Payments','An updated secure version of WooCommerce Payments is available  please ensure that youre using the latest patch version. For more information on what action you need to take, please review the article below.','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(37,'woocommerce-payments-august-2022-store-patched','update','en_US','WooCommerce Payments has been automatically updated','Youre now running the latest secure version of WooCommerce Payments. Weve worked with the WordPress Plugins team to deploy a security update to stores running WooCommerce Payments (version 3.9 to 4.5). For further information, please review the article below.','{}','pending','woocommerce.com','2022-08-11 18:54:23',NULL,0,'plain','',0,0,'info'),(38,'wc-admin-wc-helper-connection','info','en_US','Connect to WooCommerce.com','Connect to get important product notifications and updates.','{}','unactioned','woocommerce-admin','2022-08-11 18:54:24',NULL,0,'plain','',0,0,'info'),(39,'surface_cart_checkout','info','en_US','Introducing the Cart and Checkout blocks!','Increase your store\'s revenue with the conversion optimized Cart &amp; Checkout WooCommerce blocks available in the WooCommerce Blocks extension.','{}','unactioned','woo-gutenberg-products-block','2022-08-11 18:54:24',NULL,0,'plain','',0,0,'info'),(40,'wc-admin-launch-checklist','info','en_US','Ready to launch your store?','To make sure you never get that sinking \"what did I forget\" feeling, we\'ve put together the essential pre-launch checklist.','{}','unactioned','woocommerce-admin','2022-08-12 19:14:34',NULL,0,'plain','',0,0,'info'),(41,'wc-admin-choosing-a-theme','marketing','en_US','Choosing a theme?','Check out the themes that are compatible with WooCommerce and choose one aligned with your brand and business needs.','{}','unactioned','woocommerce-admin','2022-08-12 19:14:34',NULL,0,'plain','',0,0,'info'),(42,'wc-admin-insight-first-product-and-payment','survey','en_US','Insight','More than 80% of new merchants add the first product and have at least one payment method set up during the first week.<br><br>Do you find this type of insight useful?','{}','unactioned','woocommerce-admin','2022-08-12 19:14:34',NULL,0,'plain','',0,0,'info'),(43,'wc-admin-mobile-app','info','en_US','Install Woo mobile app','Install the WooCommerce mobile app to manage orders, receive sales notifications, and view key metrics  wherever you are.','{}','unactioned','woocommerce-admin','2022-08-14 05:13:40',NULL,0,'plain','',0,0,'info'),(44,'wc-admin-customizing-product-catalog','info','en_US','How to customize your product catalog','You want your product catalog and images to look great and align with your brand. This guide will give you all the tips you need to get your products looking great in your store.','{}','unactioned','woocommerce-admin','2022-08-14 05:13:40',NULL,0,'plain','',0,0,'info'),(45,'wc-admin-onboarding-payments-reminder','info','en_US','Start accepting payments on your store!','Take payments with the provider thats right for you - choose from 100+ payment gateways for WooCommerce.','{}','unactioned','woocommerce-admin','2022-08-17 10:03:50',NULL,0,'plain','',0,0,'info'),(46,'mobile_app_order_management_q3_2022','marketing','en_US','Take order management on the go','The WooCommerce Mobile App continues to get better with added order management functionality! Add or remove products, edit fees, or change the shipping options in any existing order  all from within the app.','{}','unactioned','woocommerce.com','2022-08-17 10:03:50',NULL,0,'plain','',0,0,'info'),(47,'wc-admin-usage-tracking-opt-in','info','en_US','Help WooCommerce improve with usage tracking','Gathering usage data allows us to improve WooCommerce. Your store will be considered as we evaluate new features, judge the quality of an update, or determine if an improvement makes sense. You can always visit the <a href=\"https://bkuzmanovic.wppsbootcamp.com/digitel/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com\" target=\"_blank\">Settings</a> and choose to stop sharing data. <a href=\"https://woocommerce.com/usage-tracking?utm_medium=product\" target=\"_blank\">Read more</a> about what data we collect.','{}','unactioned','woocommerce-admin','2022-08-19 19:27:41',NULL,0,'plain','',0,0,'info'),(48,'wc-admin-insight-first-sale','survey','en_US','Did you know?','A WooCommerce powered store needs on average 31 days to get the first sale. You\'re on the right track! Do you find this type of insight useful?','{}','unactioned','woocommerce-admin','2022-08-19 19:27:41',NULL,0,'plain','',0,0,'info'),(49,'product_creation_usability_test_3_months','survey','en_US','Have a say in the future of WooCommerce','Take an early look at the future of editing products in WooCommerce. Share your thoughts (~5 minutes) and help shape the experience for yourself and other merchants.','{}','unactioned','woocommerce.com','2022-08-25 18:13:22',NULL,0,'plain','',0,0,'info'),(50,'product_creation_usability_test_6_months','survey','en_US','Try the new product edit form prototype','Take an early look at the future of editing products in WooCommerce. Share your thoughts (~5 minutes) and help shape the experience for yourself and other merchants.','{}','pending','woocommerce.com','2022-08-30 19:19:32',NULL,0,'plain','',0,0,'info');
